import React, { useState, useEffect } from 'react';
import api from './api';
import './Courses.css';

function Courses() {
  const [coursesByDomain, setCoursesByDomain] = useState({});
  const [selectedDomain, setSelectedDomain] = useState('');
  const [searchKeyword, setSearchKeyword] = useState('');

  useEffect(() => {
    fetchReleasedCourses();
  }, []);

  async function fetchReleasedCourses() {
    try {
      const response = await api.get('/get-released-courses');
      const { data } = response;
  
      if (typeof data === 'object') {
        setCoursesByDomain(data); // Set courses directly
      } else {
        console.error('Invalid response format:', data);
      }
    } catch (error) {
      console.error('Error fetching released courses:', error);
    }
  }
  
  // Function to handle preview button click
  const handlePreviewClick = (courseId) => {
    // Navigate to course preview page with courseId
    console.log(`Preview clicked for course ID: ${courseId}`);
  };

  // Function to handle dropdown selection
  const handleDropdownChange = (event) => {
    setSelectedDomain(event.target.value);
  };

  // Function to handle search input change
  const handleSearchChange = (event) => {
    setSearchKeyword(event.target.value);
  };

  return (
    <div className="courses">
      <header>
        <h1>Explore and pick courses of your Interests</h1>
        {/* Dropdown for selecting domain */}
        <select value={selectedDomain} onChange={handleDropdownChange}>
          <option value="">Select Domain</option>
          <option value="IT & Software">IT & Software</option>
          <option value="Electronics">Electronics</option>
          <option value="Mechanics">Mechanics</option>
          <option value="Aeronautics">Aeronautics</option>
          <option value="Music">Music</option>
          <option value="Drawing & Design">Drawing & Design</option>
          <option value="Management">Management</option>
          <option value="Python">Python</option>
        </select>
        {/* Search bar */}
        <input type="text" placeholder="Search courses..." value={searchKeyword} onChange={handleSearchChange} />
      </header>
      <div className="course-categories">
  {/* Display courses based on selected domain or search keyword */}
  {Object.entries(coursesByDomain).map(([domain, courses]) => (
    (!selectedDomain || domain === selectedDomain) && (
      <div key={domain}>
        {domain && <h2>{domain}</h2>} {/* Ensure domain is defined before rendering */}
        <div className="course-cards">
          {courses
            .filter(
              course =>
                course.course_name &&
                course.course_name.toLowerCase().includes(searchKeyword.toLowerCase())
            )
            .map(course => (
              <div className="user-course-card" key={course.course_id}>
                <img src={course.course_thumbnail_url} alt={course.course_name} />
                <div className="course-details">
                  <h3>{course.course_name}</h3>
                  <p>Educator: {course.educator_name}</p>
                  <p>Price: {course.course_price}</p>
                  {/* Preview button */}
                  <button onClick={() => handlePreviewClick(course.course_id)}>Preview</button>
                </div>
              </div>
            ))}
          {/* If no courses match the search keyword, display a message */}
          {courses
            .filter(
              course =>
                course.course_name &&
                course.course_name.toLowerCase().includes(searchKeyword.toLowerCase())
            ).length === 0 && (
            <p>No courses available with this name.</p>
          )}
        </div>
      </div>
    )
  ))}
</div>
    </div>
  );
}

export default Courses;
